import React from 'react';
import './darkMode.scss'
import { useState } from 'react';


function DarkMode(props) {

    const [isFlexEnd, setIsFlexEnd] = useState(true);

   

    const handleClick = () => {
        setIsFlexEnd(!isFlexEnd);
      };
    
      const containerStyle = {
        display: 'flex',
        justifyContent: isFlexEnd ? 'flex-end' : 'flex-start',
        transition: 'justify-content 2s ease',
      };
 



    return ( 

        <div className='button--container' >
            
            
            <div className='button--border' style={containerStyle} > 
            <div className='button--circle'  onClick={handleClick}></div>

            </div>

        </div>

     );
}

export default DarkMode;
